import { Fragment } from "react";
import { Route, useParams } from "react-router-dom";

import Comments from "../components/comments/Comments";



const QuoteDetail = () => {
    const params = useParams();

    return (
        <Fragment>
            <h1>Quotes Detail</h1>
            <p>{params.quoteId}</p>
            <Route to='/quotes/:quoteId/comment'>
                <Comments />
            </Route>
        </Fragment>
    )
};


export default QuoteDetail;
